// Define functions
function DateDiff(date1, date2) {
    var datediff = date1.getTime() - date2.getTime(); //store the getTime diff - or +
    return (Math.ceil(datediff / (24 * 60 * 60 * 1000))); //convert value to days and return
}

function addDate(date1, numDays) {
    var dateObject = new Date(date1);
    dateObject.setDate(dateObject.getDate() + numDays);
    return dateObject;
}

function formatDate(date1) {
    return date1.getMonth() + 1 + "/" + date1.getDate() + "/" + date1.getFullYear();
}

// Calculate days out of currency
var currDateTime = new Date(); //Todays date
var currDate = formatDate(currDateTime);
var daysOut = DateDiff(new Date(currDate), new Date($(LastJump)));
var validDays;
var validUntil;

//Set recurrency fields for email message based on days out of currency
switch (true) {
    case (daysOut <= 7): // 1-7 days out of currency
        validDays = 7;
        break;
    case (daysOut <= 60): // 7-60 days
        validDays = 60;
        break;
    case (daysOut <= 90): // 60-90 days
        validDays = 90;
        break;
    case (daysOut <= 365): // 90-365 days
        validDays = 365;
        break;
    case (daysOut <= (365 * 2)): // 1 year - 2 years
        validDays = (365 * 2); //730 days
        break;
    case (daysOut <= (365 * 10)): // 2+ years
        validDays = (365 * 10); //3650 days
        break;
    case (daysOut <= (365 * 20)): // 10+ years
        validDays = (365 * 20); //7300 days
        break;
    case (daysOut <= (365 * 30)): // 20+ years
        validDays = (365 * 30); //10950 days
        break;
    case (daysOut <= (365 * 100)): // 30+ years
        validDays = (365 * 100); //36500 days
        break;
}

validUntil = addDate(currDateTime, (validDays - daysOut));
//$(DaysOut) = daysOut;
var DaysOutID = $(DaysOut_FieldID); 
document.getElementById(DaysOutID).innerHTML = daysOut;

//var recurrencyTable = document.getElementById($(RecurrencyTable_FieldID));
